function find(formname, name) {
    var k = document.forms[formname].elements.length;
    for (var j = 0; j < k; j++) {
        if (document.forms[formname].elements[j].name == name) {
            return (document.forms[formname].elements[j]);
        }
    }
}

function fill(formname, name, content) {
    find(formname, name).value = content;
}

function select(formname, name, content) {
    s = find(formname, name);
    for (var i = 0; i < s.options.length; i++) {
        if (s.options[i].innerHTML == content) {
            s.selectedIndex = i;
            return;
        }
    }
}

